import React from 'react';
import maintenance from '../assets/maintenance.jpg'

const HomePage = () => {
    return (
        <div className='container'>
            HomePage
            <img src={maintenance} alt="Hoaxify logo" />
        </div>
    );
};

export default HomePage;
